import { Button, Typography } from "@mui/material";
import Union from "../assets/Union.png";
import Bannergroup from "../assets/Bannergroup.png";
import "./Pageone.css";
import React from "react";
function Pageone() {
  return (
    <div className="banner">
      <div>
        <Typography
          sx={{
            fontSize: "40px",
            position: "relative",
            top: "54px",
            fontFamily: "Open Sans",
            fontWeight: "700",
          }}
        >
          We ensure and transform
          <br />
          business growing
        </Typography>
        <Typography
          sx={{ fontSize: "14px", position: "relative", top: "73px" }}
        >
          Lorem Ipsum is simply dummy text of the printing and typesetting
          industry. Lorem
          <br />
          Ipsum has been the industry's standard dummy text
        </Typography>
        <div>
          <Button
            variant="outlined"
            sx={{
              textTransform: "none",
              backgroundColor: "rgba(255, 93, 34, 1)",
              color: "#fff",
              borderRadius: "50px",
              position: "relative",
              top: "102.92px",
              right: "10px",
            }}
          >
            Get Started
          </Button>
          <Button
            variant="outlined"
            sx={{
              textTransform: "none",
              backgroundColor: "rgba(255, 93, 34, 1)",
              color: "#fff",
              borderRadius: "50px",
              position: "relative",
              top: "102.92px",
            }}
          >
            Learn More
          </Button>
        </div>
        <img
          src={Union}
          alt="cloud"
          style={{ position: "relative", bottom: "105px", right: "390px" }}
        />
        <img
          src={Union}
          alt="cloud"
          style={{
            position: "relative",
            bottom: "110px",
            right: "426px",
            transform: "rotate(-48deg)",
          }}
        />
        <img
          src={Union}
          alt="cloud"
          style={{
            position: "relative",
            left: "500px",
            transform: "rotate(8deg)",
          }}
        />
        <img
          src={Bannergroup}
          style={{
            position: "relative",
            top: "120px",
            right: "140px",
          }}
          alt=''
        />
      </div>
    </div>
  );
}

export default Pageone;
